import React, { useState } from 'react';

export default function DirectoryPage() {
  const [directory, setDirectory] = useState([
    {
      category: 'Grocery Stores',
      services: [
        { name: 'Himalayan Foods', location: 'Surrey, BC', contact: '+1 604-555-1234' },
        { name: 'Nepal Bazaar', location: 'Toronto, ON', contact: '+1 416-555-9876' },
      ],
    },
    {
      category: 'Restaurants',
      services: [
        { name: 'Mo:Mo Hut', location: 'Calgary, AB', contact: '+1 403-555-4567' },
        { name: 'Taste of Nepal', location: 'Vancouver, BC', contact: '+1 778-555-1122' },
      ],
    },
    {
      category: 'Cultural Organizations',
      services: [
        { name: 'NRNA Canada', location: 'National', contact: 'info@nrnacanada.org' },
        { name: 'Nepali Society of Alberta', location: 'Edmonton, AB', contact: '+1 780-555-6677' },
      ],
    },
    {
      category: 'Remittance & Support Services',
      services: [
        { name: 'IME Remit Canada', location: 'Brampton, ON', contact: '+1 905-555-3344' },
        { name: 'Canada Nepal Migration Services', location: 'Mississauga, ON', contact: '+1 647-555-7788' },
      ],
    },
  ]);

  const [form, setForm] = useState({ name: '', category: '', location: '', contact: '' });

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!form.name || !form.category || !form.location || !form.contact) return;

    const updatedDirectory = [...directory];
    const catIndex = updatedDirectory.findIndex((d) => d.category === form.category);

    if (catIndex !== -1) {
      updatedDirectory[catIndex].services.push({ name: form.name, location: form.location, contact: form.contact });
    } else {
      updatedDirectory.push({
        category: form.category,
        services: [{ name: form.name, location: form.location, contact: form.contact }],
      });
    }

    setDirectory(updatedDirectory);
    setForm({ name: '', category: '', location: '', contact: '' });
  };

  return (
    <div className="p-6 max-w-4xl mx-auto">
      <h1 className="text-3xl font-bold text-gray-800 mb-6">🛍️ Nepali Directory in Canada</h1>
      <p className="text-gray-600 mb-8">
        Explore Nepali-run businesses and support your community. You can also submit your own business below!
      </p>

      {directory.map((section, idx) => (
        <div key={idx} className="mb-8">
          <h2 className="text-xl font-semibold text-blue-700 mb-4">{section.category}</h2>
          <ul className="space-y-2">
            {section.services.map((svc, index) => (
              <li key={index} className="bg-white p-4 rounded shadow-md">
                <div className="font-medium text-lg">{svc.name}</div>
                <div className="text-sm text-gray-600">{svc.location}</div>
                <div className="text-sm text-gray-600">📞 {svc.contact}</div>
              </li>
            ))}
          </ul>
        </div>
      ))}

      <div className="mt-10 bg-gray-50 p-6 rounded-lg shadow-md">
        <h2 className="text-xl font-semibold mb-4 text-gray-800">📤 Submit Your Nepali Business</h2>
        <form onSubmit={handleSubmit} className="space-y-4">
          <input
            type="text"
            name="name"
            placeholder="Business Name"
            value={form.name}
            onChange={handleChange}
            className="w-full p-2 border border-gray-300 rounded"
            required
          />
          <input
            type="text"
            name="category"
            placeholder="Category (e.g., Grocery Store, Restaurant)"
            value={form.category}
            onChange={handleChange}
            className="w-full p-2 border border-gray-300 rounded"
            required
          />
          <input
            type="text"
            name="location"
            placeholder="City, Province"
            value={form.location}
            onChange={handleChange}
            className="w-full p-2 border border-gray-300 rounded"
            required
          />
          <input
            type="text"
            name="contact"
            placeholder="Contact Number or Email"
            value={form.contact}
            onChange={handleChange}
            className="w-full p-2 border border-gray-300 rounded"
            required
          />
          <button
            type="submit"
            className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700"
          >
            Submit Business
          </button>
        </form>
      </div>
    </div>
  );
}
